import React, { Component }  from 'react';
import Profile from "./Container/Home/Profile";

function App() {
  return (
    <div className="App" style={{
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      height: '100vh',
    }}>
      <Profile />
    </div>
  );
}

export default App;
